      new Video(
        "futsal-shuffle.img",
        "Futsal Shuffle",
        "Lil Uzi Vert",
        "Eternal Atake",
        ""
      ),
    ];
    return (
      <>
        <button
          className="m-5 btn btn-success"
          onClick={() => {
            this.setState({ currentScreen: "Your Top Artists" });
          }}
